import React from "react";
import "../IconLogo.css";
import "./Readings.css";
function Readings() {
  return (
    <div>
      <p className="text-align">
        I try to spend time reading, though I frankly read at a pace of ùõ©(N)
        while adding books to to-read list is ùõ©(N2). <br />
        Feel free to look over my Goodreads and recommend me any of your tastes!
        Genre I frequently read include: <br />
        Sci-fi <br />
        Non-fiction, esp: <br />
        Brain science <br /> Psychology <br />
        Philosophy
      </p>
      <div className="logo-align">
        <a href="https://www.goodreads.com/user/show/116837080-aubear">
          <img
            className="icon-logo"
            src="https://upload.wikimedia.org/wikipedia/commons/5/5a/Goodreads_logo_-_SuperTinyIcons.svg"
            alt="https://upload.wikimedia.org/wikipedia/commons/5/5a/Goodreads_logo_-_SuperTinyIcons.svg"
          />
        </a>
      </div>
    </div>
  );
}

export default Readings;
